          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>[<link target="_self" anchor_name="contact" url_id="29">contact</link>] [<link target="_self" anchor_name="share" url_id="29">share</link>] [<link target="_self" anchor_name="develop" url_id="29">develop</link>]</paragraph><paragraph>If you want to get involved in the eZ Community\'s life, help, be helped, share and participate, this page is for you. It gives you a list of hints and tricks on how to actually get involved.</paragraph><paragraph>Make sure you also read the&amp;nbsp;<link target="_self" url_id="30">Etiquette, blogging and usage guidelines</link></paragraph><paragraph><anchor name="contact"/></paragraph><paragraph><anchor name="eztoc772_1"/></paragraph><paragraph><anchor name="eztoc1010_1_1"/></paragraph><paragraph><anchor name="eztoc1031_0_1_1"/></paragraph><section><section><section><section><header>Contact</header><paragraph>Should anything be unclear ( after having read through the following :) ), or if you would like to ask a question, feel free to send an email to community@ez.no.</paragraph><paragraph><anchor name="share"/></paragraph><paragraph><anchor name="eztoc772_2"/></paragraph><paragraph><anchor name="eztoc1010_1_2"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2"/></paragraph></section></section></section></section><section><section><section><section><header>Sharing</header><paragraph><anchor name="eztoc772_2_1"/></paragraph><paragraph><anchor name="eztoc1010_1_2_1"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_1"/></paragraph><section><header>Forums</header><paragraph>From&amp;nbsp;<link target="_self" xhtml:title="eZ Community forums" url_id="25">http://share.ez.no/forums</link>, you can pick one of the existing forums and ask a question, make a remark, answers others\' questions, or simply read through, looking for a bit of information. The following forums are available:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="31">Install &amp; configuration</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="32">Setup &amp; design</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="33">General</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="34">Developer</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="35">Suggestions</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="36">Extensions</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li></ul></paragraph><paragraph>The "Extensions" forum is broken down into extension-specific subforums:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="37">eZ Newsletter</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="38">Website Interface</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="39">eZ Flow</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="40">eZ Find</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li></ul></paragraph><paragraph>One forum is dedicated to translators and linguists translating eZ Publish :</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" xhtml:title="Forum dedicated to translators" url_id="41">Translations</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li></ul></paragraph><paragraph>One forum is dedicated to local eZ Publish communities who do not have a dedicated platform and would like to share in their native language :</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" xhtml:title="Localized forums" url_id="42">Localized forums</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li></ul></paragraph><paragraph>A last forum welcomes suggestions for this portal:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="43">Feedback and ideas for this portal</link>&amp;nbsp;(<link target="_self" anchor_name="RSS" url_id="29">rss</link>)</paragraph></li></ul></paragraph><paragraph>It is often used in conjunction with the&amp;nbsp;<link target="_blank" xhtml:title="Issue tracker for the Community Portal" url_id="44">share.ez.no-dedicated issue tracker</link>&amp;nbsp;(not to be confused with the&amp;nbsp;<link target="_blank" xhtml:title="General eZ Publish issue tracker" url_id="45">general eZ Publish issue tracker</link>).</paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_2"/></paragraph><paragraph><anchor name="eztoc1010_1_2_2"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_2"/></paragraph></section><section><header>Your experience through an article or tutorial</header><paragraph>The&amp;nbsp;<link target="_self" xhtml:title="eZ Community Articles" url_id="46">Articles</link>&amp;nbsp;and&amp;nbsp;<link target="_self" xhtml:title="eZ Community Tutorials" url_id="47">Tutorials</link>&amp;nbsp;sections are gold mines of useful, practical information on eZ Publish and eZ Software usage. You may be willing to contribute to growing the amount of common gold by sharing one of your experiences, right here. Read more on this here :<link target="_self" url_id="48">Share your experience, write a tutorial for the Community</link>.</paragraph><paragraph><anchor name="IRC"/></paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_3"/></paragraph><paragraph><anchor name="eztoc1010_1_2_3"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_3"/></paragraph></section><section><header>Live chat on IRC</header><paragraph>Two channels are dedicated to live chat (mostly around eZ Publish and eZ Components), here they are :</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">eZ Publish room:&amp;nbsp;<link target="_self" anchor_name="ezpublish" url_id="49">irc://irc.freenode.net/#ezpublish</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">eZ Components room:&amp;nbsp;<link target="_self" anchor_name="zetacomponents" url_id="49">irc://irc.freenode.net/#zetacomponents</link></paragraph></li></ul></paragraph><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Feel free and join the chat. Usually there is a number of people willing to help you out with your problem or discuss features.&amp;nbsp;</line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">You need an&amp;nbsp;<link target="_self" anchor_name="Clients" url_id="50">IRC Client</link>&amp;nbsp;for joining the channel. Here is an indicative list of popular IRC clients :</line></paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="51">XChat</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="52">mIRC</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="53">Pidgin</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link target="_self" url_id="54">Colloquy</link></paragraph></li></ul></paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_4"/></paragraph><paragraph><anchor name="eztoc1010_1_2_4"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_4"/></paragraph></section><section><header>Blogging</header><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">A central blog planet is aggregating many community members\' blogs:<link target="_blank" xhtml:title="Planet eZ Publish" url_id="55">http://planetezpublish.org/</link>&amp;nbsp;(available through&amp;nbsp;<link target="_blank" xhtml:title="planetezpublish RSS feed" url_id="56">RSS</link>&amp;nbsp;).</line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Local initiatives exists, among them the french-speaking blog-planet :&amp;nbsp;<link target="_blank" xhtml:title="French eZ Publish blog planet" url_id="57">http://www.planet-ezpublish.fr/</link>.</line></paragraph><paragraph>Atop, this platform will soon open to public blogging, stay tuned.</paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_5"/></paragraph><paragraph><anchor name="eztoc1010_1_2_5"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_5"/></paragraph></section><section><header>Mailing-lists</header><paragraph>Feel free to register on the eZ Community mailing-list. You can do so here :<link target="_blank" xhtml:title="eZ Community mailing-list" url_id="58">http://lists.ez.no/mailman/listinfo/sdk-public</link>. It serves as a community support channel, obviously less responsive than IRC or twitter, but more persistent, which can be preferred in some cases.</paragraph><paragraph>Another mailing-list helps you see pass by every commit messages on eZ Publish\'s development trunk. If you are eager to see one specific feature implemented, or simply like to be updated with the bleeding-edge, vip status of eZ Publish, you should subscribe to that one :&amp;nbsp;<link target="_blank" url_id="59">http://lists.ez.no/mailman/listinfo/sdk-svn</link></paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_6"/></paragraph><paragraph><anchor name="eztoc1010_1_2_6"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_6"/></paragraph></section><section><header>RSS</header><paragraph><anchor name="RSS"/></paragraph><paragraph>Follow the eZ Community activity through RSS. Here are the feeds at your disposal:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">All forums (topics &amp; replies):&amp;nbsp;<link target="_self" url_id="60">http://share.ez.no/rss/feed/all_forums</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forum topics ONLY :&amp;nbsp;<link target="_self" xhtml:title="RSS feed for forum topics ONLY" url_id="61">http://share.ez.no/rss/feed/forum_topics_only</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Articles and Tutorials :&amp;nbsp;<link target="_self" url_id="62">http://share.ez.no/rss/feed/articles</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Blogs :&amp;nbsp;<link target="_self" url_id="63">http://share.ez.no/rss/feed/blogs</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Developer :&amp;nbsp;<link target="_self" url_id="64">http://share.ez.no/rss/feed/forums_developer</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Discussions :&amp;nbsp;<link target="_self" url_id="65">http://share.ez.no/rss/feed/forums_discussions</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Extensions :&amp;nbsp;<link target="_self" url_id="66">http://share.ez.no/rss/feed/forums_extensions</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Feedback :&amp;nbsp;<link target="_self" url_id="67">http://share.ez.no/rss/feed/forums_feedback</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; General :&amp;nbsp;<link target="_self" url_id="68">http://share.ez.no/rss/feed/forums_general</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Install and Configuration :<link target="_self" url_id="69">http://share.ez.no/rss/feed/forums_install_and_configuration</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Setup and Design :&amp;nbsp;<link target="_self" url_id="70">http://share.ez.no/rss/feed/forums_setup_and_design</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Suggestions :&amp;nbsp;<link target="_self" url_id="71">http://share.ez.no/rss/feed/forums_suggestions</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Forums &gt; Translation :&amp;nbsp;<link target="_self" xhtml:title="Translation related forum" url_id="72">http://share.ez.no/rss/feed/forums_translation</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Projects :&amp;nbsp;<link target="_self" url_id="73">http://share.ez.no/rss/feed/projects</link></paragraph></li></ul></paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_2_7"/></paragraph><paragraph><anchor name="eztoc1010_1_2_7"/></paragraph><paragraph><anchor name="eztoc1031_0_1_2_7"/></paragraph></section><section><header>Social networks</header><paragraph>Stay tuned on the portal\'s activity by following&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish Community on twitter" url_id="27">@ezcommunity</link>. Also, cool instant pings happen on Twitter, where many community members are active. Feel free to join this sphere, and the first step could be to follow this Twitter list :&amp;nbsp;<link target="_blank" xhtml:title="eZ Community members on Twitter" url_id="74">http://twitter.com/i_robin/cms-ezpublish/members</link>.</paragraph><paragraph>The eZ Publish Community is also gathered on LinkedIn, swing by&amp;nbsp;<link target="_blank" xhtml:title="eZ Ecosystem on LinkedIn" url_id="28">there</link>!</paragraph><paragraph>Some&amp;nbsp;<link target="_blank" xhtml:title="Google Wave" url_id="75">Waves</link>&amp;nbsp;also got attention from the community members. One way to see them is to search, from Google Wave, the following: "with:public ezpublish". So come by and wave on with us. In case you need an invitation, drop a word here :<link target="_self" url_id="76">http://share.ez.no/forums/general/ez-publish-on-google-wave</link>.</paragraph><paragraph><anchor name="develop"/>[<link target="_self" xhtml:title="Back to top" anchor_name="top" url_id="29">back to top</link>]</paragraph><paragraph><anchor name="eztoc772_3"/></paragraph><paragraph><anchor name="eztoc1010_1_3"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3"/></paragraph></section></section></section></section></section><section><section><section><section><header>Developing</header><paragraph><anchor name="eztoc772_3_8"/></paragraph><paragraph><anchor name="eztoc1010_1_3_8"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_8"/></paragraph><section><header>Collaborative development</header><paragraph>You have developed a cool extension for eZ Publish ? You would like to share it, and get other community members to help you push it ahead ? Then you should visit<link target="_blank" xhtml:title="eZ Community projects" url_id="77">http://projects.ez.no</link>&amp;nbsp;and open-source it there. You can log in with your ez.no account (the same as your share.ez.no account), and create a new project there. You may want to first check that no similar extension already exists, in which case you would probably prefer joining the existing team and tell about your ideas, suggestions and already crafted code.</paragraph><paragraph>This platform gives every project a simple collaborative development sandbox:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">forums</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">a subversion repository</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">a news wall</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">a home page</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">a rating system for people to praise or blame</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">galleries for screenshots</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">a download section</paragraph></li></ul></paragraph><paragraph><anchor name="doc"/></paragraph><paragraph><anchor name="eztoc772_3_9"/></paragraph><paragraph><anchor name="eztoc1010_1_3_9"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_9"/></paragraph></section><section><header>Documentation</header><paragraph>Online documentation helps you in your daily development and administration tasks. The official documentation for eZ Publish is available at&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish documentation" url_id="9">http://doc.ez.no</link>. A community initiative,<link target="_blank" xhtml:title="ez Publish community documentation" url_id="78">http://ezpedia.org</link>, comes as a relevant and handy knowledge base, very complimentary to the online documentation. The eZ Publish API documentation is&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish API documentation" url_id="79">here</link>, and the official documentation for the Apache Zeta Components (formerly known as eZ Components) lies<link target="_blank" xhtml:title="Apache Zeta Components" url_id="80">here</link>. The Apache Zeta Components serve nowadays, in many places, as base libraries for eZ Publish, and are a generally high-quality set of libraries for web application development.</paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_3_10"/></paragraph><paragraph><anchor name="eztoc1010_1_3_10"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_10"/></paragraph></section><section><header>Trunk, testing and sending feedback</header><paragraph><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">For every eZ Publish release, the usual alpha-beta-rc countdown should happen, and the eZ Community will be in first line to check these pre-release versions of eZ Publish Community Project and push feedback on them.</line><line xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">On top of these regular fevers, on a daily basis you may want to report issues found on eZ Publish, as well as propose enhancements. And this happens here :<link target="_blank" xhtml:title="eZ Publish general issue tracker" url_id="81">http://issues.ez.no/ezpublish</link>.</line></paragraph><paragraph>You can as well follow every step of eZ Publish\'s development by checking out the trunk version of it. It is hosted on a Github server. All you need is to visit&amp;nbsp;<link target="_blank" xhtml:title="eZ Publish Community Project\'s github repository" url_id="82">eZ Publish Community Project\'s github repository</link>, and enjoy :)</paragraph><paragraph>&amp;nbsp;<anchor name="eztoc772_3_11"/></paragraph><paragraph><anchor name="eztoc1010_1_3_11"/></paragraph><paragraph><anchor name="eztoc1031_0_1_3_11"/></paragraph></section><section><header>Translation and localisation</header><paragraph>A central community translation initiative is hosted here<link target="_blank" xhtml:title="Community Translation Initiative" url_id="83">http://projects.ez.no/ezpublish_translation</link>. The homepage of the project gives you all necessary details to get involved in translating eZ Publish into your preferred language. If you feel you have a linguist soul, or simply are fed up with not being able to use eZ Publish in your native language, this initiative is for you!</paragraph></section></section></section></section></section></section>',
