        11 => 
        eZ\Publish\SPI\Persistence\Content\Field::__set_state(array(
           'id' => 638,
           'fieldDefinitionId' => 187,
           'type' => 'ezxmltext',
           'value' => 
          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<?xml version="1.0"?>
<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph><ul><li><paragraph>Administration Interface</paragraph></li><li><paragraph>Permission and access control</paragraph></li><li><paragraph>Workflows</paragraph></li><li><paragraph>Versioning and modification tracking</paragraph></li><li><paragraph>A unique content model</paragraph></li><li><paragraph>Content cross publishing</paragraph></li><li><paragraph>Multi-site deployment</paragraph></li><li><paragraph>Search engine optimization</paragraph></li></ul></paragraph><section><header>A rich and powerful Administration Interface</header><paragraph><embed align="center" size="original" object_id="119"/></paragraph><paragraph>The content of a site can be displayed (and modified) in various ways. The Administration Interface is the advanced back-end interface, providing powerful tools for content management and editing as well as site management, configuration, customization and development.</paragraph><paragraph>In other words, you can change almost everything about a site in the Administration Interface.</paragraph><header>Permission, rights management and access control</header><paragraph><embed align="center" size="original" object_id="120"/></paragraph><paragraph>The eZ Publish access system is multi-level and role-based. This means that you can give a user or a group of users access to a combination of functions across the whole site or within a specific area of the site. For example, you restrict a certain part of a site to community or partner members.</paragraph><header>Workflows</header><paragraph><embed align="center" size="original" object_id="121"/></paragraph><paragraph>eZ Publish comes with an integrated workflow mechanism. An example of this is the built-in collaboration system, which defines an ordered sequence of actions to be executed after a content editor has published an object.</paragraph><paragraph>Suppose that your site has a restriction that all content has to go through an editor-in-chief before being published. It can be set as &#x201C;pending&#x201D; before being approved to be published. On the other hand, if a pending version is rejected by the editor, it can be set as &#x201C;rejected&#x201D;.</paragraph><paragraph>&amp;nbsp;Another example is the e-commerce engine, which can be used to manage subscriptions on a media site, automating access for paid subscribers to read premium news content, watch videos, and so on.</paragraph><header>Versioning and modification tracking</header><paragraph><embed align="center" size="original" object_id="122"/></paragraph><paragraph>Having access to older versions of content enables supervisors or editors-in-chief to check for inconsistency or errors in the content. eZ Publish automatically keeps track of which content changes were made by which users at what time, and provides the option to revert content to a previous version.</paragraph><header>A unique content model</header><paragraph><embed align="center" size="original" object_id="123"/></paragraph><paragraph>Publishing content is no longer only about publishing articles. Depending on your needs you must define specific content structures for cars, recipes, specific products for your webshop and more. eZ Publish has a flexible content engine that enables administrators to create these content definitions directly through graphical user interfaces.</paragraph><header>Content cross publishing</header><paragraph><embed align="center" size="original" object_id="124"/></paragraph><paragraph>Using the cross publishing feature, you can re-use content throughout the site while avoiding inconsistent duplicates of content that are hard to maintain. If content appears at multiple locations, you only have to edit the object once &#x2013; the changes will be reflected at all locations.</paragraph><header>Multi-site deployment</header><paragraph><embed align="center" size="original" object_id="125"/></paragraph><paragraph>One installation of eZ Publish can host many different websites with the possibility to re-use content, functionality and design across the different sites. You can have a continuous overview of all your sites and can even industrialize this deployment via the Site Factory management service in <link url_id="85">eZ Publish Premium</link> subscription services.</paragraph><header>URL management and search engine optimization</header><paragraph><embed align="center" size="original" object_id="126"/></paragraph><paragraph>eZ Publish makes it easy for you to create content that will be effectively indexed by search engines. Sitemaps, friendly URLs, and easy management of key XHTML tags are all built-in features.</paragraph></section></section></section>
',
