           'value' => 
          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<?xml version="1.0"?>
<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>Enable and configure the workflow:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Create workflow</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Connect workflow to new triggers</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Register user with approval workflow enabled</paragraph></li></ul></paragraph><paragraph>Enable the approval workflow functionality:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Go to the Administration Interface - &#x201C;Setup&#x201D; - &#x201C;Workflows&#x201D;</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><line>Create a user registration workflow, e.g &#x201C;UserRegistration1&#x201D;</line><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">The FinishUserRegistration workflow is used to end the registration and trigger a confirmation notification that the user is successfully registered&amp;nbsp;</paragraph></li></ul></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">Create a workflow to finish the user registration, e.g &#x201C;FinishUserRegistration&#x201D;</paragraph></li></ul></paragraph><paragraph><embed align="center" view="embed-inline" size="original" custom:offset="0" custom:limit="5" object_id="133"/></paragraph><paragraph>Connect the two workflows to triggers:</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">&#x201C;UserRegistration1&#x201D; to &#x201C;content-publish-before&#x201D;</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">&#x201C;FinishUserRegistration&#x201D; to &#x201C;content-publish-after&#x201D;</paragraph></li></ul></paragraph><paragraph><embed align="center" view="embed-inline" size="imagelarge" custom:offset="0" custom:limit="5" object_id="134"/></paragraph><paragraph>Now you have set up a workflow approval process. When a user logs in to register himself as a user he is presented with an approval workflow</paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">At first time login the user clicks "Sign up" to register an account</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">&amp;nbsp;When finished a mail is sent to to confirm the user email</paragraph></li></ul></paragraph><paragraph><embed align="center" view="embed-inline" size="imagelarge" custom:offset="0" custom:limit="5" object_id="135"/></paragraph><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">In the administration interface an event is created in the Dashboard&#x2019;s&amp;nbsp; &#x201C;Collaboration&#x201D; screen of an administrator or another role with the right policies</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">The administrator can now either comment, approve or deny the request for user registration</paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/">The user gets a confirmation mail and can log in to eZ Publish.</paragraph></li></ul></paragraph></section>
',
