           'value' => 
          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/"><section><paragraph>For simple siteaccesses, like nor, fre, ger, eng the feature works out of the box &amp;nbsp;</paragraph><paragraph><ul><li><paragraph>More complex mappings require a manual configuration in the file</paragraph></li><li><paragraph>You use the canonical link to tell the search engines which url is the preferred one when you have several duplicate urls.</paragraph></li></ul></paragraph><paragraph>Example of duplicate urls:</paragraph><paragraph>- <link url_id="95">www.example.com</link></paragraph><paragraph>- example.com</paragraph><paragraph>- <link url_id="96">www.example.com/index.html</link></paragraph><paragraph>- example.com/home.asp</paragraph><paragraph>Example of canonical link:</paragraph><paragraph>&lt;link rel="canonical" href="<link url_id="95">http://www.example.com</link>/" /&gt;</paragraph></section></section>',
