        eZ\Publish\SPI\Persistence\Content\Field::__set_state(array(
           'id' => 1208,
           'fieldDefinitionId' => 186,
           'type' => 'ezxmltext',
           'value' => 
          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish is more than a basic CMS, but a content management platform based on a clear API that allows developers to customize and extend eZ Publish.</paragraph></section>',
