        11 => 
        eZ\Publish\SPI\Persistence\Content\Field::__set_state(array(
           'id' => 1209,
           'fieldDefinitionId' => 187,
           'type' => 'ezxmltext',
           'value' => 
          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<?xml version="1.0"?>
<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><ul><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="contentclass" url_id="103">The content class concept</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="customdesign" url_id="103">Custom design: CSS and templates</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="phpcomponents" url_id="103">High-quality library of PHP components</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="buildextensions" url_id="103">Build eZ Publish extensions</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="developmentenvironment" url_id="103">Which development environment?</link></paragraph></li><li><paragraph xmlns:tmp="http://ez.no/namespaces/ezpublish3/temporary/"><link anchor_name="ezcommunity" url_id="103">eZ Publish community and resources</link></paragraph></li></ul></paragraph><section><section><header>The content class concept</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="212"/></paragraph><paragraph>Any piece of content in eZ Publish is a content object, which is an instance of a specific content class. A content class is a definition of an arbitrary data structure. It does not store any actual data. </paragraph><paragraph>A content class is made up of attributes. The characteristics of an attribute are determined by the datatype that is chosen for that specific attribute. By combining different datatypes, it is possible to represent complex data structures. </paragraph><paragraph>The illustration above shows the anatomy of a content class called "Article", which defines a data structure for storing news articles. It consists of attributes dedicated for storing the title, an introduction text and the actual body of an article.</paragraph></section></section><section><section><header>Custom design: CSS and templates</header><paragraph><embed size="original" view="embed" custom:offset="0" custom:limit="5" object_id="213"/></paragraph><paragraph>The first thing you may be willing to do is to change the look of your eZ Publish site. This can be done by modifying the CSS of eZ Publish and <link url_id="86">overriding templates</link>. You can even create reusable <link url_id="87">site packages</link> that include these CSS and template changes. </paragraph></section></section><section><section><header>High-quality library of PHP components</header><paragraph>eZ Publish 4.X as well as the next generations of eZ Publish are based on <link url_id="88">eZ Components</link> which are a high quality library of independent components aiming to help developers creating web centric applications like for example customising and extending eZ Publish. </paragraph><paragraph>In the eZ Components you will find components that focus their attention on solving important parts of Web application development. They are written for solving the re-occurring issues that Web application developers have to deal with when building their applications - without any superfluous ballast. </paragraph><paragraph>In order to cater for this goal, quality is also an important factor. The eZ Components development team uses a test-driven development methodology where a large effort is put into making the APIs easily testable. This also results in a better API for developers to use. </paragraph></section></section><section><section><header>Build eZ Publish extensions</header><paragraph>There is a clear API to develop your own PHP extensions in order to extend the functionality of eZ Publish. By using extensions it is possible to create new modules, datatypes, template operators, workflow events , or any integration with third party applications. You will find many contributed extensions available at <link url_id="89">Contribution page</link>. </paragraph></section></section><section><section><header>Which development environment?</header><paragraph> In an eZ Publish project, a <link target="_blank" url_id="90">Subversion (SVN)</link> repository is usually set up to track all changes during development projects. When it comes to IDE, both <link target="_blank" url_id="91">Eclipse</link> and <link target="_blank" url_id="92">PHPEdit</link> have been optimised for eZ Publish. </paragraph></section></section><section><section><header>eZ Publish community and resources</header><paragraph>When you start developing with eZ Publish, the community is definitely an environment to get in touch with. You will find your answers or get help in the forums as well as many contributions that will make save you time in your development projects. </paragraph></section></section></section>
',
