          eZ\Publish\SPI\Persistence\Content\FieldValue::__set_state(array(
             'data' => '<section xmlns:image="http://ez.no/namespaces/ezpublish3/image/" xmlns:xhtml="http://ez.no/namespaces/ezpublish3/xhtml/" xmlns:custom="http://ez.no/namespaces/ezpublish3/custom/"><paragraph>eZ Publish 4.5 supports a canonical link feature that helps search engines to figure out duplicate content issues and allow them to index relevant content.</paragraph></section>',
